import styled from 'styled-components'

const Container=styled.div`
    display:flex;
    flex-direction:row;
    width:100%;
    height:100%;

`
const Conteudo=styled.div`
    width:50vw;
    height:100%;
`
const Formulario=styled.div`
    display:flex;   
    width:50vw;
    height:100vh;
    display:flex;
    justify-content:center;
    align-items:center;
    background:var(--search);
`
export {Container,Formulario,Conteudo}
